import React, { useState } from 'react';
import { NavLink } from 'react-router-dom';
import NightsStayIcon from '@material-ui/icons/NightsStay';
import WbSunnyIcon from '@material-ui/icons/WbSunny';

function Navbar() {


    function moon() {
        document.body.classList.toggle("dark");
        let sun = document.getElementById("sun");
        let moons = document.getElementById("moon");
        moons.style.display = "none";
        sun.style.display = "flex";
    }
    function suns() {
        document.body.classList.toggle("dark");
        let sun = document.getElementById("sun");
        let moons = document.getElementById("moon");
        moons.style.display = "flex";
        sun.style.display = "none";
    }


    return (
        <>
            <div className="container">
                <nav class="navbar navbar-expand-lg navbar bg-light">
                    <div class="container-fluid">
                        <a class="navbar-brand" href="#">ThapaTechnical</a>
                        <button class="navbar-toggler" type="button" data-bs-toggle="collapse" data-bs-target="#navbarSupportedContent" aria-controls="navbarSupportedContent" aria-expanded="false" aria-label="Toggle navigation">
                            <span class="navbar-toggler-icon"></span>
                        </button>
                        <div class="collapse navbar-collapse" id="navbarSupportedContent">
                            <ul class="navbar-nav me-auto mb-2 mb-lg-0">
                                <li class="nav-item">
                                    <NavLink activeClassName="active" className="nav-link" exact to="/">Home</NavLink>
                                </li>
                                <li class="nav-item">
                                    <NavLink activeClassName="active" className="nav-link" exact to="/service">Service</NavLink>
                                </li>
                                <li class="nav-item">
                                    <NavLink activeClassName="active" className="nav-link" exact to="/about">About</NavLink>
                                </li>
                            </ul>
                        </div>
                    </div>
                </nav>
            </div>



            {/* <div className="menu">
                    <div className="logo">
                        <h2>ThapaTechnical</h2>
                    </div>
                    <div className="li">
                        <NavLink activeClassName="active" exact to="/">Home</NavLink>
                        <NavLink activeClassName="active" exact to="/service">Services</NavLink>
                        <NavLink activeClassName="active" exact to="/about">About</NavLink>
                        <NavLink activeClassName="active" exact to="/contact">Contact</NavLink>
                    </div>
                    <div onClick={moon} id="moon">
                        <NightsStayIcon />
                    </div>
                    <div style={{display:'none'}} id="sun" onClick={suns}>
                        <WbSunnyIcon />
                    </div>
                </div> */}
        </>
    )
}


export default Navbar;
